typeql:
match
$e isa offshore_entity;
registered_address (registrant: $e, registered_addr: $a);
$a has address $addr;
reduce $entity_count = count($e) groupby $a, $addr;
sort $entity_count desc;
limit 10;
fetch {
  "address": $addr,
  "entity_count": $entity_count
};

match
$e isa offshore_entity, has status "Defaulted";
registered_address (registrant: $e, registered_addr: $a);
$a isa postal_address;
fetch {
  "address": $a.address
};

match
$e isa other, has note "Closed date stands for Liquidation date.";
fetch {
  "entity_name": $e.name,
  "note": $e.note
};

match
$o isa officer, has valid_until "The Panama Papers data is current through 2015";
fetch {
  "name": $o.name
};

match
$e isa offshore_entity, has former_name $fn, has name $n;
fetch {
  "entity_name": $n,
  "former_name": $fn
};

match $o isa officer, has last_edit_timestamp $t;
sort $t desc;
limit 5;
fetch { "name": $o.name, "lastEditTimestamp": $t };

match
$e isa offshore_entity, has jurisdiction $j;
reduce $count = count($e) groupby $j;
sort $count desc;
limit 5;
fetch { "jurisdiction": $j };

match $e isa other, has entity_type "FOREIGN FORMED CORPORATION";
fetch {
  "entity_name": $e.name,
  "incorporation_date": $e.incorporation_date,
  "jurisdiction": $e.jurisdiction,
  "jurisdiction_description": $e.jurisdiction_description
};

match
$e isa offshore_entity, has name $n, has tax_stat_description $td;
fetch {
  "entity_name": $n,
  "tax_description": $td
};

match
$o isa officer;
$e isa offshore_entity;
connected_to (connector: $o, connected_entity: $e);
fetch {
  "officer_name": $o.name,
  "entity_name": $e.name
};

match
$i isa intermediary;
$e isa offshore_entity;
officer_of (officer: $i, offshore_entity: $e);
fetch {
  "IntermediaryName": $i.name,
  "EntityName": $e.name
};

match
$e isa offshore_entity, has company_number $cn, has name $n;
fetch {
  "entity_name": $n,
  "company_number": $cn
};

match
