$e isa offshore_entity;
$r isa officer_of (officer: $o, offshore_entity: $e);
$r has link "shareholder of";
fetch {
  "OfficerName": $o.name,
  "EntityName": $e.name
};

match
$e1 isa officer;
$e2 isa officer;
same_id_as (id_source: $e1, id_target: $e2);
fetch {
  "Entity1": $e1.name,
  "Entity2": $e2.name
};

match
$e isa offshore_entity, has inactivation_date $d, has name $n;
sort $d desc;
limit 5;
