match
$i isa intermediary;
$e isa offshore_entity;
$r isa intermediary_of (intermediary: $i, offshore_entity: $e), has start_date $sd;
sort $sd desc;
limit 5;
fetch {
  "IntermediaryName": $i.name,
  "EntityName": $e.name,
  "ConnectionStartDate": $sd
};

match
$o isa officer;
$e isa offshore_entity, has name "MOSSFON SUBSCRIBERS LTD.";
same_name_as (named_source: $o, named_target: $e);
fetch {
  "name": $o.name
};

match
$e isa offshore_entity, has former_name $fn, has name $n;
fetch {
  "entity_name": $n,
  "former_name": $fn
};

match
$e isa offshore_entity;
$a isa postal_address, has countries "Hong Kong";
registered_address (registrant: $e, registered_addr: $a);
fetch {
  "entity_name": $e.name,
  "address": $a.address
};

match $i isa intermediary, has last_edit_timestamp $t;
sort $t desc;
limit 5;
fetch { "name": $i.name, "last_edit_timestamp": $t };

match
$e isa offshore_entity, has incorporation_date 2006-03-23;
fetch {
  "entity_name": $e.name,
  "entity_status": $e.status
};

match
$e isa offshore_entity, has status "Defaulted";
fetch {
  "entity_name": $e.name,
  "associated_countries": $e.countries
};

match
$e isa offshore_entity, has last_edit_timestamp $t;
$t < "1638311040000";
fetch {
  "name": $e.name,
  "lastEditTimestamp": $t
};

match
$e isa offshore_entity, has jurisdiction_description "Samoa";
$o isa other;
connected_to ($e, $o);
fetch {
  "OtherEntityName": $o.name,
  "JurisdictionDescription": $o.jurisdiction_description
};

match
$i isa intermediary, has name $int_name;
$e isa offshore_entity, has name $ent_name;
intermediary_of (intermediary: $i, offshore_entity: $e);
sort $int_name;
limit 5;
fetch {
  "Intermediary": $int_name,
  "Entity": $ent_name
};

match
$e isa offshore_entity, has node_id $nid, has name $n;
$nid > 10000000;
fetch {
  "name": $n,
  "node_id": $nid
};

match
$o isa officer;
$e isa offshore_entity;
$r isa officer_of (officer: $o, offshore_entity: $e), has link "Nominee Shareholder of";
fetch {
  "OfficerName": $o.name,
  "EntityName": $e.name
};

match
$a isa postal_address;
$e isa offshore_entity;
registered_address (registrant: $e, registered_addr: $a);
reduce $count = count($e) groupby $a;
match $count > 1;
$a has address $addr;
sort $count desc;
fetch { "Address": $addr, "EntityCount": $count };

match
$e1 isa offshore_entity, has name "Top Games Holdings Inc.", has last_edit_timestamp $ts;
$e2 isa offshore_entity, has name $n2, has last_edit_timestamp $ts;
$n2 != "Top Games Holdings Inc.";
fetch {
  "EntityName": $n2,
  "LastEditTimestamp": $ts
};

match
$e isa offshore_entity, has tax_stat_description $t;
fetch {
  "name": $e.name,
  "tax_stat_description": $t
};

match
$e isa offshore_entity, has closed_date $cd;
not { $e has struck_off_date $sd; };
fetch {
  "entity_name": $e.name,
  "closed_date": $cd
};

match
$rel isa $t, has link $link, has valid_until $valid_until;
{ $t label registered_address; } or { $t label same_company_as; } or { $t label same_name_as; } or { $t label intermediary_of; } or { $t label officer_of; } or { $t label connected_to; } or { $t label same_id_as; };
select $link, $valid_until;
distinct;
sort $valid_until desc;
limit 3;
fetch { "connection_type": $link, "valid_until": $valid_until };

match
$e isa offshore_entity, has name "TIANSHENG INDUSTRY AND TRADING CO., LTD.";
$sameEntity isa offshore_entity;
same_as (same_as_source: $e, same_as_target: $sameEntity);
fetch {
  "sameEntity": { $sameEntity.* }
};

match
$e isa offshore_entity, has name "Top Games Holdings Inc.";
registered_address (registrant: $e, registered_addr: $a);
registered_address (registrant: $other, registered_addr: $a);
$other isa offshore_entity;
not { $other is $e; };
fetch {
  "entity_name": $other.name
};

match
$i isa intermediary, has source_id "Panama Papers", has status "ACTIVE", has name $n;
fetch {
  "intermediary_name": $n
};

match
$e isa offshore_entity,
  has name $name,
  has struck_off_date $date;
$date >= 2014-01-01;
$date < 2015-01-01;
fetch {
  "entity_name": $name,
  "struck_off_date": $date
};

match
$o isa officer;
$a isa postal_address, has address $addr, has countries "Samoa";
$addr like ".*Apia.*";
registered_address (registrant: $o, registered_addr: $a);
fetch {
  "OfficerName": $o.name,
  "Address": $addr
};

match
$e isa offshore_entity, has jurisdiction "SAM", has closed_date $closed_date, has name $name;
fetch {
  "entity_name": $name,
  "closed_date": $closed_date
};

match
$o isa other, has entity_type "LIMITED LIABILITY COMPANY", has name $n;
fetch {
  "name": $n
};

match
$a isa postal_address, has address $addr, has last_edit_timestamp $ts;
sort $ts desc;
limit 5;
fetch {
  "address": $addr,
  "lastEditTimestamp": $ts
};

match
$a isa postal_address, has valid_until $vu;
$vu like ".*2020.*";
fetch {
  "address": $a.address,
  "valid_until": $vu
};

match
$e isa offshore_entity, has company_number $cn;
$cn like "^240.*";
$o isa officer;
officer_of (officer: $o, offshore_entity: $e);
fetch {
  "officer_name": $o.name,
  "entity_name": $e.name,
  "company_number": $cn
};

match
$o isa officer, has source_id "Panama Papers", has note $n, has name $name;
fetch {
  "name": $name
};

match
$e isa offshore_entity,
  has inactivation_date 2013-02-18,
  has struck_off_date 2013-02-15;
fetch {
  "entity_name": $e.name,
  "inactivation_date": $e.inactivation_date,
  "struck_off_date": $e.struck_off_date
};

match
$e isa other, has entity_type "FOREIGN FORMED CORPORATION", has source_id "Paradise Papers - Aruba corporate registry";
fetch {
  "name": $e.name
};

match
$e isa offshore_entity,
    has incorporation_date $d,
    has service_provider "Mossack Fonseca";
$d >= 2006-01-01;
$d < 2007-01-01;
fetch {
    "entity_name": $e.name,
    "incorporation_date": $d,
    "service_provider": $e.service_provider
};

match
$i isa intermediary, has name "MICHAEL PAPAGEORGE, MR.";
intermediary_of (intermediary: $i, offshore_entity: $e);
fetch {
  "entity_name": $e.name,
  "entity_status": $e.status
};

match
$o isa officer, has source_id "Bahamas Leaks";
$rel isa officer_of (officer: $o), has status "ACTIVE";
fetch {
  "name": $o.name,
  "node_id": $o.node_id,
  "country_codes": $o.country_codes,
  "countries": $o.countries
};

match
$e isa offshore_entity, has name $name, has incorporation_date $inc_date;
$inc_date == 2006-03-23;
fetch {
  "entity_name": $name,
  "incorporation_date": $inc_date
};

match
$e isa offshore_entity, has jurisdiction_description "Samoa";
fetch {
  "name": $e.name,
  "jurisdiction_description": $e.jurisdiction_description
};

match
$e isa offshore_entity, has status "Defaulted", has inactivation_date $d;
$d >= 2013-01-01;
$d <= 2013-12-31;
fetch { "name": $e.name };

match
$e isa offshore_entity, has service_provider "Mossack Fonseca", has name $n;
sort $n;
limit 5;
fetch {
  "entity_name": $n,
  "service_provider": $e.service_provider
};

match
$e isa offshore_entity, has country_codes "HKG";
fetch {
  "name": $e.name,
  "country_codes": $e.country_codes
};

match
$e isa offshore_entity, has struck_off_date $d, has name $n;
$d >= 2013-02-01;
$d <= 2013-02-28;
fetch {
  "entity_name": $n,
  "struck_off_date": $d
};

match
$e isa offshore_entity;
$a isa postal_address, has address "ORION HOUSE SERVICES (HK) LIMITED ROOM 1401; 14/F.";
registered_address (registrant: $e, registered_addr: $a);
fetch {
  "entity_name": $e.name
};

match
$e isa offshore_entity, has last_edit_timestamp "1638311020926";
fetch {
  "name": $e.name
};

match
$e isa offshore_entity, has valid_until $vu, has name $n;
$vu like ".*2015.*";
fetch {
  "entity_name": $n,
  "valid_until": $vu
};

match
$i isa intermediary, has countries "South Africa";
$i has name $n;
sort $n;
limit 3;
fetch {
  "intermediary_name": $i.name,
  "intermediary_address": $i.address,
  "intermediary_status": $i.status
};

match
$i isa intermediary, has status "ACTIVE";
fetch {
  "intermediary_name": $i.name,
  "countries": $i.countries,
  "address": $i.address
};

match
$i isa intermediary;
$a isa postal_address, has address "MICHAEL PAPAGEORGE; MR. 106 NICHOLSON STREET BROOK";
registered_address (registrant: $i, registered_addr: $a);
fetch {
  "IntermediaryName": $i.name
};

match
$i isa intermediary;
$e isa offshore_entity, has countries $c;
$c like ".*Panama.*";
intermediary_of (intermediary: $i, offshore_entity: $e);
fetch {
  "IntermediaryName": $i.name,
  "EntityName": $e.name
};

match
$i isa intermediary, has source_id "Panama Papers";
intermediary_of (intermediary: $i, offshore_entity: $e);
fetch {
  "IntermediaryName": $i.name
};

match
$i isa intermediary, has countries $c;
select $c;
distinct;
fetch { "countries": $c };

match
$o isa officer, has name $n;
$n == "KIM SOO IN";
fetch {
  "officer": {
    "name": $o.name,
    "node_id": $o.node_id
  }
};

match
$e isa offshore_entity, has jurisdiction "SAM", has name $en;
$o isa officer, has name $on;
connected_to (connector: $o, connected_entity: $e);
fetch {
  "officer_name": $on,
  "entity_name": $en
};

match
$o isa officer, has country_codes "KOR";
fetch {
  "officer_name": $o.name,
  "country_code": $o.country_codes
};

match
$o isa officer;
officer_of (officer: $o, offshore_entity: $e);
$e isa offshore_entity;
select $o;
distinct;
fetch { "OfficerName": $o.name };

match
$a isa postal_address, has countries "Bahamas";
reduce $numberOfAddresses = count($a);

match
$e isa offshore_entity;
fetch {
  "entity_name": $e.name,
  "inactivation_date": $e.inactivation_date,
  "status": $e.status
};

match
$e1 isa offshore_entity, has name "SKY-BLUE GIFTS & TOYS CO., LTD.";
same_company_as (company1: $e1, company2: $e2);
fetch {
  "name": $e2.name
};
